import styles from './ReportForm.module.css'

import { FormControl, FormLabel, RadioGroup, FormControlLabel, TextField } from '@material-ui/core';
import Radio from '@material-ui/core/Radio';

import React, { useState } from 'react';


function ReportForm({ open, onCancel }: { open: boolean, onCancel: any }) {
    return (
        <div onClick={onCancel} className={styles.box} style={{ display: open ? 'block' : 'none' }}>
            <div onClick={(e) => { e.stopPropagation() }} className={styles.contentBox}>
                <FormDisabledDemo />
            </div>
        </div>
    )
}

export default ReportForm;




const normFile = (e: any) => {
    if (Array.isArray(e)) {
        return e;
    }
    return e?.fileList;
};

const FormDisabledDemo: React.FC = () => {
    const [actionType, setActionType] = useState("1");

    return (
        <>
            <div className={styles.title1}>GSK 不良事件报告表</div>
            <div className={styles.title2}>机构/项目信息</div>
            <FormControl className={styles.formControl} component="fieldset">
                <div className={styles.actionTypeBox}>
                    <RadioGroup row aria-label="position" name="position" defaultValue='1'>
                        <FormLabel component="legend" style={{ color: '#666', lineHeight: '42px', height: '40px', fontSize: 14 }}>*活动类型</FormLabel>
                        <FormControlLabel labelPlacement="start" value="1" control={<Radio />} label={<div style={{ color: '#666', fontSize: 14 }}>市场研究</div>} />
                        <FormControlLabel labelPlacement="start" value="2" control={<Radio />} label={<div style={{ color: '#666', fontSize: 14 }}>患者支持项目</div>} />
                        <FormControlLabel labelPlacement="start" value="3" control={<Radio />} label={<div style={{ color: '#666', fontSize: 14 }}>数字媒体</div>} />
                    </RadioGroup>
                </div>
                <div className={styles.subContent}>
                    <TextField className={styles.textField} style={{ width: '57%'}} color="secondary" required id="standard-required" label="* 该机构是什么时候接收到安全性信息的（年/月/日）？" defaultValue="2020/9/11" />
                    <TextField className={styles.textField} style={{ width: '33%', fontSize:'25px' }} color="secondary" required id="standard-required" label={<div style={{fontSize:13}}>* 项目名称/机构编号</div>} defaultValue="压力测试号" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* 报告者识别号" defaultValue="yuanqiao" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* 机构名称和地址" defaultValue="NA" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* 项目编号/活动识别号" defaultValue="NA" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* WISE编码（针对市场研究项目）" defaultValue="NA" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* 机构电话" defaultValue="NA" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* ChimAERa编码（针对患者支持项目）" defaultValue="NA" />

                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* 机构电邮" defaultValue="NA" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* 机构联系人姓名" defaultValue="NA" />
                    <TextField className={styles.textField} style={{ width: '30%' }} color="secondary" required id="standard-required" label="* 机构联系人签名和日期" defaultValue="NA" />
                </div>


            </FormControl>


        </>
    );
};
